window.bookSummaryJSON = "<p>Starting over after my father’s sudden death was bad enough, but the four boys who rule Alstone College, my new university, are determined to make my life even more difficult. One in particular. Caiden Cavendish.<br> My nightmare. My shadow. My stepbrother.</p> <p>My dad’s death was an accident... Lie.<br> My life isn’t in danger... Lie.<br> The Four won’t bring mayhem to my life... Lie.<br> I don’t want Caiden Cavendish... Lie.<br> Lies.<br> Lies.<br> <i>Lies.</i></p> <p>Eeny, meeny, miny, mo.<br> The Four are coming for you, Snow.</p> <p><b>Note: This book is not a stand-alone, and may contain triggers for some listeners.</b></p>"; 
